import React from 'react';
import Card from '../../../../UI/Card/Card';
import classes from './Contact.module.css';

const paragraph = 'Get in touch with us for any information or help at:\nTel.: 0759874658\nEmail: trauma.team@tteam.com';

function Contact({ onClose }) {
    return (
        <Card>
            <div>
                <h1 className={classes.header}>Contact Information</h1>
                <button className={classes.closeButton} onClick={onClose}>Close</button>
                <p className={classes.body}>{paragraph}</p>
            </div>
        </Card>
    );
}

export default Contact;
